import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <div className='footer-container'>
      <section className='footer-subscription'>
        <p className='footer-subscription-text'>
          2022 캡스톤무사완주프로젝트
        </p>
      </section>
    </div>
  );
}

export default Footer;
